INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Delivery', 'Our terms and conditions of delivery', 'conditions, delivery, delay, shipment, pack', '<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>', 'delivery'),
(4, 1, 1, 'About us', 'Learn more about us', 'about us, informations,zen, techonologies', '<h1 class="page-heading bottom-indent"><img src="http://localhost/prestashop/img/cms/about_us_banner.jpg" alt="" width="100%" height="100%" /></h1>\n<div class="row">\n<div class="col-xs-12 col-sm-12">\n<div class="cms-box">\n<h1><b>About us</b></h1>\n<p style="text-align:justify;">Zen a Japanese term finds its root in the vedic term "dhyana", meaning "meditation". Zen is a way of creative living, a philosophy of dynamic action and a highway to bliss, knowledge and ecstacy. In this contemporary world, Zen has been synonymous with everything that is Novel, Fresh, Full of life, Creative, Simple and Sophisticated. Today''s management, leadership and business philosophy is replete with the concepts of quality and innovation derived from Zen.</p>\n<p style="text-align:justify;">Being truly rooted in this philosophy, we at Zen Educational Technologies settle to contribute nothing less than the very best to our customers. With relentless pursuit for excellence, <br />a maniac obsession for quality, wildly imaginative creativity and mind boggling innovation, we always bring out top of the line block-buster magical products. Customer joy, delight and satisfaction are the true rewards we are aiming for</p>\n<p style="text-align:justify;">Zen Educational technologies, the research and development wing of Vikram Prakashan, Gadag has ventured into the field of Research, consultancy, Program development <br />(Seminars &amp; Workshops), Software development, Multimedia Kits, Publication, Media &amp; Web solutions for the field of Education. The core team of 120 members orchestrating 24/7 to develop insanely beautiful products consists of extremely talented &amp; highly experienced Researchers, Academicians, Technologists, Professors, Editors, Writers, Designers, Visualizers &amp; Developers.</p>\n<p style="text-align:justify;"></p>\n<h4><span class="table"><strong>Contact Address :</strong> </span></h4>\n<p>Zen Educational Technologies<br />No.80, Shravanthi Sapphire, IIIrd Floor, 21st Main Road, BSK II Stage, Near BDA Shopping Complex<br />Bangalore - 560070. </p>\n<h4><br /><br /><strong><span class="table">Innovation and Research Centre:</span></strong></h4>\n<p><strong><span class="table"></span></strong><br /><span>No. 101, 4th Floor, Shri Manjunatha Complex, </span><br /><span>22nd Main Road, Banashankari 2nd Stage,</span><br /><span>Near BDA shopping complex</span><br /><span>Bangalore 560070</span></p>\n<p><br /><br /><strong><span class="table">Phone :</span></strong><span> 080-42124242/99451 88884 </span><br /><br /><strong><span class="table">Email :</span></strong><span> info@zenstudents.com</span></p>\n</div>\n</div>\n</div>', 'about-us'),
(5, 1, 1, 'Secure payment', 'Our secure payment method', 'secure payment, ssl, visa, mastercard, paypal', '<h2>Secure payment</h2>\r\n<h3>Our secure payment</h3><p>With SSL</p>\r\n<h3>Using Visa/Mastercard/Paypal</h3><p>About this service</p>', 'secure-payment'),
(6, 1, 1, 'Privacy', 'privacy_policy', 'privacy,policy,zen,technologies', '', 'privacy');
