INSERT INTO `ps_manufacturer_lang` (`id_manufacturer`, `id_lang`, `description`, `short_description`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1, 1, '<p style="text-align:justify;"><span>Zen Educational technologies, the research and development wing of Vikram Prakashan, Gadag has ventured into the field of Research, consultancy, Program development </span><br /><span>(Seminars &amp; Workshops), Software development, Multimedia Kits, Publication, Media &amp; Web solutions for the field of Education. The core team of 120 members orchestrating 24/7 to develop insanely beautiful products consists of extremely talented &amp; highly experienced Researchers, Academicians, Technologists, Professors, Editors, Writers, Designers, Visualizers &amp; Developers.</span></p>', '<p style="text-align:justify;"><span>Zen a Japanese term finds its root in the vedic term "dhyana", meaning "meditation". Zen is a way of creative living, a philosophy of dynamic action and a highway to bliss, knowledge and ecstacy. In this contemporary world, Zen has been synonymous with everything that is Novel, Fresh, Full of life, Creative, Simple and Sophisticated. Today''s management, leadership and business philosophy is replete with the concepts of quality and innovation derived from Zen.</span></p>', '', '', '');
